    "51782a23-0382-4845-b0a1-4009f651b259": {"id":"51782a23-0382-4845-b0a1-4009f651b259","project_id":14264,"key":36577698,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:41.252Z","updated_at":"2022-09-26T00:23:41.252Z","props":{"bulletColor":"#fff","content":"\u003cp data-type=\"paragraph\"\u003eCheck the full address of any emails you receive to ensure the sender and display-name details match\u003c/p\u003e"},"type":"Text"}, 
    "5b33bb71-87a0-4b76-9214-f3e0b2ffcbe4": {"id":"5b33bb71-87a0-4b76-9214-f3e0b2ffcbe4","project_id":14264,"key":36577697,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:41.245Z","updated_at":"2022-09-26T00:23:41.245Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eHenry the hacker could now cleverly mimic John in an email to Jenny. Pretending to be John, he advised Jenny that payments must now be paid into a new bank account – his own.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "a982dd57-714a-482d-895b-f5004d48c665": {"id":"a982dd57-714a-482d-895b-f5004d48c665","project_id":14264,"key":36577696,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:41.240Z","updated_at":"2022-09-26T00:23:41.240Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eJenny got this scam email pretty soon after receiving the original authentic invoice from John. The scam email looked real and its timing made it more believable. She paid the large sum directly into the hacker’s account. He then disappeared along with the money.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "8ab8dd26-6a2a-44e8-a24e-6b7cdc793d74": {"id":"8ab8dd26-6a2a-44e8-a24e-6b7cdc793d74","project_id":14264,"key":36577695,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:41.234Z","updated_at":"2022-09-26T00:23:41.234Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eJenny clicked on this link allowing Henry to download malware on to her device. This malware could monitor her emails. Henry simply waited for any messages about payments and invoices. As soon as he saw the invoice John sent to Jenny, he acted!\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "9a5392f8-91a9-40fb-b624-ac6ee1c0ee10": {"id":"9a5392f8-91a9-40fb-b624-ac6ee1c0ee10","project_id":14264,"key":36577694,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:41.228Z","updated_at":"2022-09-26T00:23:41.228Z","props":{"bulletColor":"#fff","content":"\u003cp data-type=\"paragraph\"\u003eReplied to the second email from \u0026#x27;John\u0026#x27; asking him to confirm his identity before approving the payment\u003c/p\u003e"},"type":"Text"}, 
