    "b2d380fa-2f50-4313-ac9b-53b1a180a603": {"id":"b2d380fa-2f50-4313-ac9b-53b1a180a603","project_id":14264,"key":36577367,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:39.323Z","updated_at":"2022-09-26T00:23:39.323Z","props":{"useBackgroundControls":false,"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"font-size:18px\" data-type=\"fontSize\"\u003eEvaluate source\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThe sender of the email will be trying to trick you into believing they are someone else. However, it’s likely that there are clues in the message. Think about the tone, is it too formal? Are they using your full name or a nickname? Does it feel ‘off’?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eCheck the full email address.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
