    "978c403c-fb76-423f-b21f-d48f315e2a37": {"id":"978c403c-fb76-423f-b21f-d48f315e2a37","project_id":14264,"key":36578063,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:43.686Z","updated_at":"2022-09-26T00:23:43.686Z","props":{"useBackgroundControls":false,"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"font-size:18px\" data-type=\"fontSize\"\u003eMalware\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003ePhishing attacks can introduce malware onto a victim’s computer. This is successful when a victim opens an attachment on an email. Once opened, malicious software (malware) gets installed onto their system. Malware can spread further and shutdown a whole organisation’s system for a ransom. It can also be used to spy on emails and steal confidential information to commit further crimes.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "4317e3a6-9ff6-481b-a3e6-17c3402bd259": {"id":"4317e3a6-9ff6-481b-a3e6-17c3402bd259","project_id":14264,"key":36578061,"version":null,"meta":{"subType":"Interaction"},"children":[{"id":"e3186c15-3139-4e0e-887b-d1e514947082","type":"Ref"}],"deleted_at":null,"created_at":"2022-09-26T00:23:43.674Z","updated_at":"2022-09-26T00:23:47.103Z","props":{},"type":"AnimationGroup"}, 
    "a6c8831b-9ae5-47e9-9e95-ac3db29f46b4": {"id":"a6c8831b-9ae5-47e9-9e95-ac3db29f46b4","project_id":14264,"key":36578059,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:43.662Z","updated_at":"2022-09-26T00:23:43.662Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eHow can I prevent this happening?\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eYou’ve learnt how easily BEC can happen but what can you do to stop it?\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eJust as we identified with Jenny, we should start by checking if the email is from who it actually says it is from.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick on the three headings to see how to check the full address.\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
