    "7b44cf86-7e2d-49c1-b20f-c0fff7966594": {"id":"7b44cf86-7e2d-49c1-b20f-c0fff7966594","project_id":14264,"key":36577078,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.596Z","updated_at":"2022-09-26T00:23:37.596Z","props":{"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-18l6ruy-rules\" style=\"color:#004c97\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhat is Business Email Compromise?\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eLet’s find out as we follow Jenny, who is about to become the victim of a Business Email Compromise (BEC) attack. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eClick the arrows to move through all four carousel slides.\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eNote for keyboard users:\u003c/strong\u003e when you\u0026#x27;re ready to move on to the next slide within the carousel, ensure the \u0026#x27;next slide\u0026#x27; button is selected, then press enter.\u003c/p\u003e"},"type":"Text"}, 
