    "f92dbe71-2695-4797-94bd-9c72bbaf3a09": {"id":"f92dbe71-2695-4797-94bd-9c72bbaf3a09","project_id":14264,"key":36577074,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.572Z","updated_at":"2022-09-26T00:23:37.572Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eDouble click on the display name in preview panel\u003c/p\u003e"},"type":"Text"}, 
    "4bff8da0-e420-45ae-b589-7f229d77906a": {"id":"4bff8da0-e420-45ae-b589-7f229d77906a","project_id":14264,"key":36577071,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.554Z","updated_at":"2022-09-26T00:23:37.554Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eJenny makes the payment using the new account details to avoid any late payment issues.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "f6a78c64-ca15-4250-b69a-779df2abecee": {"id":"f6a78c64-ca15-4250-b69a-779df2abecee","project_id":14264,"key":36577070,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.548Z","updated_at":"2022-09-26T00:23:37.548Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eLast week Jenny received an email from her IT team with a link to reset her password for her electronic signature. However, the email and link were not from her IT team. They were actually from Henry, a hacker, who was using a phishing scam to gather information and identify targets for his next cyberattack.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "8c584663-0e09-469d-9681-17975616eb8e": {"id":"8c584663-0e09-469d-9681-17975616eb8e","project_id":14264,"key":36577068,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.535Z","updated_at":"2022-09-26T00:23:37.535Z","props":{"src":"images/image_865562.svg","imageId":865562,"imgSize":0,"width":150,"height":150},"type":"Image"}, 
    "79bb24d9-4d04-46c6-ba36-78ed4a2d5e07": {"id":"79bb24d9-4d04-46c6-ba36-78ed4a2d5e07","project_id":14264,"key":36577067,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.529Z","updated_at":"2022-09-26T00:23:37.529Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eGetting to know your target\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/h2\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eAs you saw with Jenny’s story, criminals can forge emails so that they appear to come from someone you know or trust. This is called email spoofing. But what other tactics do cybercriminals use to build a detailed picture of their target? You might have identified some in Jenny’s story already.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eClick on the three cards below to learn more.\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "d8359ff6-c8a8-4134-b336-2bc5750f1c22": {"id":"d8359ff6-c8a8-4134-b336-2bc5750f1c22","project_id":14264,"key":36577066,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:23:37.523Z","updated_at":"2022-09-26T00:23:37.523Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eIt’s not just checking the email address that will make a difference\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\u003c/h2\u003e\u003c/div\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eSenior managers and people with financial authority are more likely to be targeted by cybercriminals. But as we saw cyberattacks are more successful when the hacker does their homework and builds a complete picture of their target. This means they could target any of us for information that will help them commit future crimes.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eIt’s up to you to always act with care when you suspect an email compromise cyberattack.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003eClick on the three cards below to learn how you can prevent becoming a victim of BEC.\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
